import React from 'react';
import { Row, Col } from 'antd';
const Product = () => {
  return (
    <Row>
      <Col span={6}>col-6</Col>
      <Col span={6}>col-6</Col>
      <Col span={6}>col-6</Col>
      <Col span={6}>col-6</Col>
    </Row>
  );
};

export default Product;
